export default class Home extends Component {
  render() {
    return (
      <React.Fragment>
      <div className="Home">
      <img src="https://c0.wallpaperflare.com/preview/986/807/681/beer-brewery-pints-glasses.jpg" alt=""></img>
      </div>
      <div className="stage">
        <div className="layer">
        </div>
      </div>

      <div class="loading wave">
  Loading
</div>
      </React.Fragment>
    )
  }
}
